package com.evo.ib.google.ArrAndStrings;

import java.util.*;

public class LongestStringNDistinct {

    public static String nDistictChar(String s, int k) {
        Map<Character, Integer> distictCharCount = new HashMap<>() ;
        List<String> solns = new ArrayList<>() ;
        s = s.toLowerCase(Locale.ROOT) ;
        int curr_start = 0 ;
        int curr_end = 0 ;
        int max_curr_atart = curr_start ;
        int max_length = 1 ;
        distictCharCount.put(s.charAt(0), 1) ;
        for (int i = 1 ; i < s.length() ; i++) {
            if (distictCharCount.containsKey(s.charAt(i))) {
                distictCharCount.put(s.charAt(i), distictCharCount.get(s.charAt(i)) + 1) ;

            }
            else {
                distictCharCount.put(s.charAt(i), 1);
            }
            curr_end++ ;
            while (distictCharCount.size() > k) {
                int val =  distictCharCount.get(s.charAt(curr_start)) ;
                val = val - 1 ;
                if (val == 0)
                    distictCharCount.remove(s.charAt(curr_start)) ;
                else
                    distictCharCount.put(s.charAt(curr_start), val) ;
                curr_start++ ;
            }
            if ((distictCharCount.size() == k) &&  ((curr_end - curr_start +1) > (max_length))) {
                max_length = curr_end - curr_start +1 ;
                max_curr_atart = curr_start ;
                solns.clear();
                solns.add(s.substring(max_curr_atart, max_curr_atart+max_length)) ;
            }


            if ((distictCharCount.size() == k) && ((curr_end - curr_start +1) == (max_length))) {
                if (max_curr_atart != curr_start) {
                    max_curr_atart = curr_start ;
                    solns.add(s.substring(max_curr_atart, max_curr_atart + max_length));
                }
            }
        }
        System.out.println(solns);
        if (distictCharCount.size() == k)
        return (s.substring(max_curr_atart, max_curr_atart+max_length)) ;
        else return null ;
    }

    public static void main(String[] args) {
        //System.out.println(nDistictChar("geeksforgeeks", 6)) ;
        System.out.println(nDistictChar("", 2));
    }
}
